import React, {Component} from "react";
import { Layout, Row, Col, Icon, Divider, Dropdown,  Button} from 'antd';
import Nav from "./nav"
// const { Header} = Layout;可嵌套
class MainHeader extends Component {
    render() {
        return( 
            <Layout.Header>
                <Row className="wrap">
                    <Col md={6} xs={24}>
                        <h1 id="logo">cNode</h1>
                    </Col>
                    <Col md={12} xs={0} >
                        <Nav
                            id="nav"
                            mode="horizontal"
                        />
                      

                      
                        <Divider id="divide" type="vertical" className="headerDivider" />
                    </Col>
                    <Col md={0} xs={24} className="xsNav">
                        <Dropdown 
                            overlay={
                                <Nav
                                    id="xsNav"
                                    mode="vertical"
                                />
                            }
                            placement = "bottom"
                            trigger = {["click", "touchend"]}
                        >
                            <Button><Icon type="bars"/></Button>
                        </Dropdown>
                    </Col>
                    
                </Row>
            
          </Layout.Header>
        );
    }
}
export default MainHeader
